import * as React from 'react';
import '@toast-ui/editor/dist/toastui-editor-viewer.css';
import { Viewer } from '@toast-ui/react-editor';
import { useParams, useLocation, Link, useNavigate  } from "react-router-dom";
import styled from "styled-components";
import * as ReactDOM from 'react-dom';
import axios from "axios";
import { connect } from 'react-redux';
import CommentSection from './../shared/Comment';
import {Background,Content,Category,Header,OtherDetail,Description,Recommand,GoToList,Correction,Delete,
  PostInfor, PostBtnSection, PostRecommand, PostScrape} from "./../shared/PageElements"

const Title = styled.div`
width: 924px;
height: 21px;
font-size: 18px;
font-weight: 700;
border: none;
margin-bottom: 10px;
`

const Right = styled.span`
float: right;
`

const BtnSection = styled.div`
margin-top: 12.5px;
padding-bottom: 12.5px;
`

let getPage = { // 서버에서 가져온 page의 정보라고 가정.
  title: "플러터 스터디 모집합니다. 초보자 환영입니다.",
  isSecret: false,
  countOfRecommend: 0, // 게시글의 추천수
  isRecommend: false,  //서버에서 이 유저가 게시글에 추천을 했는지 확인한다. true면 추천한 것이다.
  author: "김승태",
  date: "2021.12.21",
  time: "23:44",
  example: ` <p>본문을 적어주세요.fsdfdsfsdfdsf</p>
  <p>fdsfsfsdf</p><p>fwefwef</p><p>fsfsdfsdf</p><ul>
  <li class="task-list-item" data-task="true"><p>코드는 깔끔한가?</p></li>
  <li class="task-list-item" data-task="true"><p>이해하기 쉽게 직관적인가?</p></li>
  <li class="task-list-item" data-task="true"><p><br class="ProseMirror-trailingBreak"></p></li></ul> 
  <p><img src="data:image/png;base64," contenteditable="false"><img class="ProseMirror-separator"><br class="ProseMirror-trailingBreak"></p>
  
  
  
  `
  // editor에 넣을 예제값이다.
}



let userInfor = {
  userName: "김승태",
  userId: "testId"
}

const checkRecommend = (isRecommend) => {
  if (isRecommend) {
    return "추천취소"
  }
  else {
    return "추천"
  }

}

function mapStateToProps(state) {
  return state;
}

function Page(props) {
  const params = useParams();
  const filter = useLocation().state;
  const [countOfRecommend, setCountOfRecommend] = React.useState(getPage.countOfRecommend); // 게시글 추천수
  const [isRecommend, setIsRecommend] = React.useState(checkRecommend(getPage.isRecommend)); // 게시글 추천 유무 확인에 따라 값 변경.
  const Navigate = useNavigate();
 
  const postRecommand = () => { // 게시글 추천하는 함수
    if (isRecommend === "추천취소") {
      axios.delete(`/posts/like?postId=6`,{
        headers: {'Authorization': `Bearer ${props.tokenReducer}`}
      })
      .catch(function (error) {
        console.log(error.toJSON());
      })
      .then(function(res){
        console.log(res);
      });
      setCountOfRecommend((count) => count - 1);
      setIsRecommend("추천")
    }
    else {
      axios.post(`/posts/like?postId=6`,{},{
        headers: {'Authorization': `Bearer ${props.tokenReducer}`}
      })
      .catch(function (error) {
        console.log(error.toJSON());
      })
      .then(function(res){
        console.log(res);
      });
      setCountOfRecommend((count) => count + 1);
      setIsRecommend("추천취소")
    }
  }

  const handleDeleteClick = () => { // 게시글 삭제하는 함수
    //axios로 delete하고 다시 보드 보여주기.
    let value = window.confirm("해당게시물을 삭제하겠습니까?")
    if (value) {
      axios.delete(`/posts?postId=5`,{
        headers: {'Authorization': `Bearer ${props.tokenReducer}`}
      })
      .catch(function (error) {
        console.log(error.toJSON());
      })
      .then(function(res){
        console.log(res);
      });
      Navigate("/board", {
        state: { category: filter.subCategory }
      })
    }

    return value;
  }

  window.onpopstate = function(event){
    console.log("work!");
    Navigate("/board",{state:{category:filter.subCategory, page:filter.page}})
  }

  return (
    <div>
      <Background>
        <Content>
          <Category>{filter.category}|{filter.subCategory}</Category>

          <Header>
            <Title>{getPage.title}</Title>
            <OtherDetail>{getPage.author}|{getPage.date}|{getPage.time}<Right>조회 143|추천 {countOfRecommend}|댓글3</Right></OtherDetail>
          </Header>

          <Description>
            <Viewer initialValue={getPage.example} />
            <PostInfor><span>댓글 {3}</span> | <span>추천 {24}</span> | <span>스크랩 {3}</span></PostInfor>
            <PostBtnSection>
              <PostRecommand value="추천" onClick={postRecommand}>{isRecommend}</PostRecommand>
              <PostScrape>스크랩</PostScrape>
            </PostBtnSection>
          </Description>
          
          <CommentSection />

          <BtnSection>
          <Link to="/board"
                  state={
                    {category:filter.subCategory}
                  }
            ><GoToList >목록으로</GoToList></Link>
            {(getPage.author === userInfor.userName) ?  // user의 이름과 게시글 작성자가 같다면 보여주고 아니라면 편집기능 구현 x
              <div style={{ float: "right" }}>
                <Link
                  to={`/board/update/${params.pagenum}/${userInfor.userId}`}
                  state={
                    {
                      title: getPage.title,
                      text: getPage.example,
                      isSecret: getPage.isSecret,
                      boardType: filter.category,
                      subCategory: filter.subCategory
                    }
                  }
                ><Correction>수정</Correction>
                </Link>
                <Delete onClick={handleDeleteClick}>삭제</Delete>

              </div>
              :
              null}
          </BtnSection>
        </Content>
      </Background>

    </div>
  );
}
export default connect(mapStateToProps)(Page);